// Array para armazenar os endereços I2C lidos dos registradores Modbus
let i2cAddresses = [];

// Percorre o payload recebido do Modbus Read e converte cada valor para hexadecimal
for (let i = 0; i < msg.payload.length; i++) {
    let address = msg.payload[i];

    // Verifica se o endereço é válido (diferente de zero)
    if (address !== 0) {
        // Converte o valor para hexadecimal com 2 dígitos
        let hexAddress = "0x" + address.toString(16).toUpperCase();
        i2cAddresses.push(hexAddress);
    }
}

// Formata o array de endereços I2C em uma string
msg.payload = "I2C Devices: " + i2cAddresses.join(", ");

// Retorna a mensagem para ser exibida no dashboard ou log
return msg;

